(function (jsPDFAPI) {
  var font = '';
  var callAddFont = function () {
    this.addFileToVFS('thaisansneue-regular-webfont-normal.ttf', font);
    this.addFont('thaisansneue-regular-webfont-normal.ttf', 'thaisansneue', 'normal');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont])
})(jsPDF.API);